import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import '../../css/InstructorModuleDisplayPage.css'; // Import the CSS file

const InstructorModuleDisplayPage = () => {
  const { moduleId } = useParams();
  const [module, setModule] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [newLectureMaterial, setNewLectureMaterial] = useState({ title: '', description: '', url: '' });

  useEffect(() => {
    const fetchModuleDetails = async () => {
      try {
        const response = await fetch(`/api/instructor/modules/${moduleId}`);
        if (!response.ok) {
          throw new Error(`HTTP error! status: ${response.status}`);
        }
        const data = await response.json();
        setModule(data);
      } catch (error) {
        setError(error);
      } finally {
        setLoading(false);
      }
    };

    fetchModuleDetails();
  }, [moduleId]);

  const handleAddLectureMaterial = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch(`/api/instructor/modules/${moduleId}/content`, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ contentType: 'lectureMaterials', content: newLectureMaterial }),
      });

      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }

      const updatedModule = await response.json();
      setModule(updatedModule);
      setNewLectureMaterial({ title: '', description: '', url: '' }); // Clear the form
    } catch (error) {
      console.error('Error adding lecture material:', error);
      // Optionally set an error state for the user
    }
  };

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error.message}</div>;
  }

  if (!module) {
    return <div>Module not found</div>;
  }

  return (
    <div className="instructor-module-container">
      <h1>{module.title}</h1>
      <p>{module.description}</p>

      <div className="module-section">
        <h3>Lecture Materials</h3>
        <ul>
          {module.lectureMaterials.map((item) => (
            <li key={item._id}>
              <h4>{item.title}</h4>
              <p>{item.description}</p>
              {item.url && <a href={item.url} target="_blank" rel="noopener noreferrer">Link</a>}
              {/* Add Edit and Delete buttons later */}
            </li>
          ))}
        </ul>

        <h4>Add New Lecture Material</h4>
        <form onSubmit={handleAddLectureMaterial}>
          <input
            type="text"
            placeholder="Title"
            value={newLectureMaterial.title}
            onChange={(e) => setNewLectureMaterial({ ...newLectureMaterial, title: e.target.value })}
            required
          />
          <textarea
            placeholder="Description"
            value={newLectureMaterial.description}
            onChange={(e) => setNewLectureMaterial({ ...newLectureMaterial, description: e.target.value })}
          />
          <input
            type="text"
            placeholder="URL"
            value={newLectureMaterial.url}
            onChange={(e) => setNewLectureMaterial({ ...newLectureMaterial, url: e.target.value })}
          />
          <button type="submit">Add Lecture Material</button>
        </form>
      </div>

      <div className="module-section">
        <h3>Quizzes</h3>
        {/* Display existing quizzes and form to add new */}
      </div>

      <div className="module-section">
        <h3>Assignments</h3>
        {/* Display existing assignments and form to add new */}
      </div>

      <div className="module-section">
        <h3>Announcements</h3>
        {/* Display existing announcements and form to add new */}
      </div>
    </div>
  );
};

export default InstructorModuleDisplayPage;
